import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
  color: '#fff',
  textDecoration: 'none'
};

const headerStyle = {
  height: 100,
  paddingTop: 10,
  backgroundColor: '#090a0b'
}

const Header = () => (
  <div style={headerStyle}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
